            sentence += f"{airport} serves {triple.object}. "
        elif triple.predicate == "country":
            country = triple.object
            if airport:
                sentence += f"{airport} is located in {country}. "
            else:
                sentence += f"{triple.subject} is in {triple.object}. "
        elif triple.predicate == "capital":
            capital = triple.object
            if country:
                sentence += f"The capital of {country} is {capital}. "
            else:
                sentence += f"The capital of {triple.subject} is {triple.object}. "
